column28:
BKII Prüfung meiner Klasse in meinem Fach gut ausgefallen. Ich habe mich gefreut! 
Freitag mein freier Tag, Samstag mein Geburtstag mit Feier im Familienkreis, Ferienbeginn. Habe mir frei genommen, bin glücklich; 

Meine Klasse hat eine gute BWL-Prüfung abgelegt (Freude). Hatte am Freitag Hochzeitstag, am Samstag Geburtstag (Feier mit der Familie). Pfingstferien haben begonnen. Mein Sohn kam (Freitag) und geht mit uns in Urlaub. Mir geht es sehr gut!

